Tournament, The (2009)  

Verenigd Koninkrijk
Actie / Thriller

geregisseerd door Scott Mann
met Robert Carlyle, Kelly Hu en Ving Rhames

Elke tien jaar vindt er in een willekeurige stad 'The Tournament' plaats. Dit is een strijd tot de dood tussen de beste 40 huurmoordenaars ter wereld. De laatste persoon die overblijft krijgt een prijs van 10 miljoen dollar en de titel van 's werelds nummer 1. Dit gebeurt allemaal onder het toezicht van een select groepje miljardairs die gokken op een mogelijke uitkomst.

Vertaald door Simply ReleaseS Toppers
Tokke, Daboy, Delapluma en Suurtje.

